INSERT INTO Books VALUES(61,'Atomic & Molecular Symmetry Groups and Chemistry.pdf','Data/Books/Atomic & Molecular Symmetry Groups and Chemistry.pdf',20248002,19.3099999999999987,425,'dc82e528cc80f64dab895e1ecb30608deeb4233da84724f0a5df75a194de56a7','Atomic & Molecular Symmetry Groups and Chemistry','S.C. Rakshit',NULL,NULL,NULL,'English',NULL,'Atomic & Molecular Symmetry Groups and Chemistry','S.C. Rakshit','Atomic Symmetry Groups, being continuous groups, are just a fallout of the Lie Groups and Lie Algebras. Atoms are structurally simpler than molecules but atomic symmetry is more complex than molecular symmetry. In quantum mechanics we study atoms first and then the molecules. In symmetry studies, we do just the reverse. In this book, apart from theories, the description of both the symmetry groups – atomic and molecular, are attended with adequate applications. Please note: Taylor &amp; Francis does not sell or distribute the Hardback in India, Pakistan, Nepal, Bhutan, Bangladesh and Sri Lanka. In quantum mechanics we study atoms first and then the molecules. In symmetry studies, we do just the reverse. In this book, apart from theories, the description of both the symmetry groups – atomic and molecular, are attended with adequate applications. Please note: T&F does not sell or distribute the Hardback in South Asia.','PScript5.dll Version 5.2.2','Adobe Acrobat 10.0 Paper Capture Plug-in','D:20210507',NULL,NULL,NULL,NULL,NULL,'',NULL,'','',NULL,NULL,NULL,NULL,'PyMuPDF','2025-07-01T20:45:46.108478',NULL,'',NULL,0,0,0,0,'Data/Covers/Atomic & Molecular Symmetry Groups and Chemistry.png','Data/Thumbs/Atomic & Molecular Symmetry Groups and Chemistry.png','2025-07-01T20:45:46.108482','2025-07-02 00:45:46',NULL,1);
