INSERT INTO Books VALUES(328,'You Are a Badass How to Stop Doubting Your Greatness.pdf','Data/Books/You Are a Badass How to Stop Doubting Your Greatness.pdf',1384120,1.32000000000000006,689,'0cd8cbf00651445fd44fbb739299f37ae1cf1e8a121bfb93cd38280c7425064e','You Are a Badass','Jen Sincero',NULL,NULL,NULL,'English',NULL,'You Are a Badass','Jen Sincero','<div><p></p>Bestselling author, speaker and world-traveling success coach, Jen Sincero, cuts through the din of the self-help genre with her own verbal meat cleaver in <i>You Are a Badass: How to Stop Doubting Your Greatness and Start Living an Awesome Life</i>. In this refreshingly blunt how-to guide, Sincero, serves up 27 bite-sized chapters full of hilariously inspiring stories, life-changing insights, easy exercises and the occasional swear word. <br> <br>Via chapters such as "Your Brain is Your Bitch," "Fear is for Suckers" and "My Subconscious Made Me Do It," Sincero takes you on a wild joy ride to your own transformation, helping you create the money, relationships, career and general all around awesomeness you so desire. And should you be one of those people who dreads getting busted with a self-help book in your hands, fear not. Sincero, a former skeptic herself, delivers the goods minus the New-Age cheese, giving even the...</div>','calibre 2.14.0 [http://calibre-ebook.com]','calibre 2.14.0 [http://calibre-ebook.com]','D:20150924',NULL,NULL,NULL,NULL,NULL,'',NULL,'','',NULL,NULL,NULL,NULL,'PyMuPDF','2025-07-01T20:45:51.134895',NULL,'',NULL,0,0,0,0,'Data/Covers/You Are a Badass How to Stop Doubting Your Greatness.png','Data/Thumbs/You Are a Badass How to Stop Doubting Your Greatness.png','2025-07-01T20:45:51.134898','2025-07-02 00:45:51',NULL,1);
