INSERT INTO Books VALUES(484,'Artificial Intelligence and the Fourth Industrial Revolution.pdf','Data/Books/Artificial Intelligence and the Fourth Industrial Revolution.pdf',29695672,28.3200000000000002,313,'7bb54a5e25ad444240dfe665c9820ed114e71b523818caf840a52062f4641557','Artificial Intelligence and the Fourth Industrial Revolution','Utpal Chakraborty',NULL,NULL,NULL,'English',NULL,'Artificial Intelligence and the Fourth Industrial Revolution','Utpal Chakraborty','This book presents the overall technology spectrum in artificial intelligence (AI) and the Fourth Industrial Revolution, which is set to revolutionize the world. It discusses their various aspects and related case studies from industry, academics, administration, law, finance, and accounting as well as educational technology. The contributors, who are experts in their respective fields and from industry and academia, focus on a gesture-recognition prototype for specially abled people; jurisprudential approach to AI and legal reasoning; automated chatbot for autism spectrum disorder using AI assistance; Big Data analytics and Internet of Things (IoT); role of AI in advancement of drug discovery; development, opportunities, and challenges of the Fourth Industrial Revolution; legal, ethical, and policy implications of AI; Internet of Health Things for smart healthcare and digital wellbeing; machine learning and computer vision; computer vision-based system for automation and industrial applications; AI-IoT in home-based healthcare; and AI in super-precision human brain and spine surgery. Buttressed with comprehensive theoretical, methodological, well-established, and validated empirical examples, the book covers the interests of a broad audience from basic science to engineering and technology experts and learners. It will be greatly helpful for CEOs, entrepreneurs, academic leaders, researchers, and students of engineering, biomedicine, and master’s programs in science as well as the vast workforce and students with technical or non-technical backgrounds. It also serves common public interest by presenting new methods to improve the quality of life in general, with a better integration into society. This book covers the overall technology spectrum in AI and the Fourth Industrial Revolution that is set to revolutionize the world as we know it. It is a handbook for CEOs, entrepreneurs, and university VCs, as well as the vast workforce and students with tech or non-tech','dvips(k) 5.99 Copyright 2010 Radical Eye Software','Acrobat Distiller 10.0.0 (Windows)','D:20220325',NULL,NULL,NULL,NULL,NULL,'',NULL,'','',NULL,NULL,NULL,NULL,'PyMuPDF','2025-07-01T20:45:53.924796',NULL,'',NULL,0,0,0,0,'Data/Covers/Artificial Intelligence and the Fourth Industrial Revolution.png','Data/Thumbs/Artificial Intelligence and the Fourth Industrial Revolution.png','2025-07-01T20:45:53.924799','2025-07-02 00:45:53',NULL,1);
