INSERT INTO Books VALUES(651,'Solved Problems in Geometry and Trigonometry.pdf','Data/Books/Solved Problems in Geometry and Trigonometry.pdf',5117050,4.87999999999999989,221,'675b9759a090cf32830625a9282262cbc3ff5ec5d8de8bd5b152fce3f0a500c4','Compiled and Solved Problems in Geometry and Trigonometry','Florentin Smarandache',NULL,NULL,'9781599732992','English',NULL,'Compiled and Solved Problems in Geometry and Trigonometry','Florentin Smarandache','This book is a translation from Romanian of "Probleme Compilate şi Rezolvate de Geometrie şi Trigonometrie" (University of Kishinev Press, Kishinev, 169 p., 1998), and includes 255 problems of 2D and 3D Euclidean geometry plus trigonometry, compiled and solved from the Romanian Textbooks for 9th and 10th grade students, in the period 1981-1988, when I was a professor of mathematics at the "Petrache Poenaru" National College in Balcesti, Valcea (Romania), Lycée Sidi El Hassan Lyoussi in Sefrou (Morocco), then at the "Nicolae Balcescu" National College in Craiova and Dragotesti General School (Romania), but also I did intensive private tutoring for students preparing their university entrance examination. After that, I have escaped in Turkey in September 1988 and lived in a political refugee camp in Istanbul and Ankara, and in March 1990 I immigrated to United States. The degree of difficulties of the problems is from easy and medium to hard. The solutions of the problems are at the end of each chapter. One can navigate back and forth from the text of the problem to its solution using bookmarks. The book is especially a didactical material for the mathematical students and instructors.','Microsoft® Word 2013','Microsoft® Word 2013','D:20150203',NULL,NULL,NULL,NULL,NULL,'9781599732992',NULL,'','',NULL,NULL,NULL,NULL,'PyMuPDF','2025-07-01T20:45:56.254969',NULL,'',NULL,0,0,0,0,'Data/Covers/Solved Problems in Geometry and Trigonometry.png','Data/Thumbs/Solved Problems in Geometry and Trigonometry.png','2025-07-01T20:45:56.254972','2025-07-02 00:45:56',NULL,1);
