INSERT INTO Books VALUES(856,'Bash Cookbook  Solutions and Examples for bash Users.pdf','Data/Books/Bash Cookbook  Solutions and Examples for bash Users.pdf',7067402,6.74000000000000021,968,'5c5fec78f5c7d4d503a760bd1e64e6a4182dcd778cd9ae8dbfafd5c3af5b9245','bash Cookbook','Carl Albing','O’Reilly Media, Inc',2018,NULL,'English',NULL,'bash Cookbook','Carl Albing','<p>For system administrators, programmers, and end users, shell command or carefully crafted shell script can save you time and effort, or facilitate consistency and repeatability for a variety of common tasks. This cookbook provides more than 300 practical recipes for using <i>bash</i>, the popular Unix shell that enables you to harness and customize the power of any Unix or Linux system.</p><p>Ideal for new and experienced users alike&#8212;including proficient Windows users and sysadmins&#8212;this updated second edition helps you solve a wide range of problems. You''ll learn ways to handle input/output, file manipulation, program execution, administrative tasks, and many other challenges. Each recipe includes one or more scripting examples and a discussion of why the solution works.</p><p>You''ll find recipes for problems including:</p><li>Standard output and input, and executing commands</li><li>Shell variables, shell logic, and arithmetic</li><li>Intermediate shell tools and...','calibre 3.10.0 [https://calibre-ebook.com]','calibre 3.10.0 [https://calibre-ebook.com]','D:20171025',NULL,NULL,NULL,NULL,NULL,'',2018,'O’Reilly Media, Inc','',NULL,NULL,NULL,NULL,'PyMuPDF','2025-07-01T20:45:59.460858',NULL,'',NULL,0,0,0,0,'Data/Covers/Bash Cookbook  Solutions and Examples for bash Users.png','Data/Thumbs/Bash Cookbook  Solutions and Examples for bash Users.png','2025-07-01T20:45:59.460861','2025-07-02 00:45:59',NULL,1);
